import {useEffect, useState} from 'react';
import Todoitem from './Todoitem';


const Todolist=()=>{

    const [starttime_,setSDate]=useState("");
    const [endtime_,setEDate]=useState();
    const [content_,setContent]=useState("");
    const [items,setItem]=useState([
        {start_time:"12",end_time:"20",content:"Go Library"}
    
    ]);


    useEffect(()=>{
        console.log('render');

    });
 
    const add=(e)=>{
        e.preventDefault();
        setItem([
            ...items,{
            start_time: starttime_,
            end_time: endtime_,
            content:content_

        }]);
    
    };

    const mapping=Todolist.map(items=>{
        return(
            <Todoitem item={items}>

            </Todoitem>
        )
    });

    return(
        <div >
            <form add={add}>
                <input type="text" placeholder="start time" value={starttime_}>
                </input><br></br>
                <input type="text" placeholder="end time" value={endtime_}>
                </input><br></br>
                <input type="text" width="400px" height="400px" placeholder="content" value={content_}>
                </input><br></br>
                
                <button type="submit">Add</button>
            </form>
           
        </div>
    );
}

export default Todolist;
